import React from "react";
import './App.scss';
export default class Article extends React.Component {
    constructor(props) {
        super ( props );
    }

    render() {
        let imgUrl = this.props.image;
        return (
            <div className={"article"}>
                <img src={`/assets/${this.props.image}`}/>
                {this.props.name}
                {this.props.color}
                {this.props.price}
            </div>)
    }
}
